<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>NameSpace</title>
    <script>
    var myObj ;
    (function(){
        var name = "my,on my";
        myObj = {
            getName : function(){
                return name;
            }
        }
    })();
    myObj.getName();
    console.log(myObj.getName());

    var myObj2 = (function(){
        var name = 'my,on my2';
        return {
            getName : function() {
                return name;
            }
        }
    }());
    myObj2.getName();
    console.log(myObj2.getName());
    </script>
</head>
<body>

</body>
</html>
